import React, { useEffect, useState } from 'react';
import './Dashboard.css';
import axios from 'axios';

const Dashboard = () => {
  const [users, setUsers] = useState('');

  useEffect(() => {
    const fetchUsers = async () => {
      try {
        const response = await axios.get('http://localhost:8002/api/users');
        setUsers(response.data);
      } catch (error) {
        console.log('Error fetching data', error);
      }
    };

    fetchUsers();
  }, []);

  return (
    <div className="dashboard">
      <header className="header">
        <h1>Dashboard</h1>
      </header>
      <nav className="sidebar">
        <ul>
          <li><a href="/">Home</a></li>
          <li><a href="/">Analytics</a></li>
          <li><a href="/">Settings</a></li>
          <li><a href="/">Logout</a></li>
        </ul>
      </nav>
      <main className="main-content">
        <section className="section">
          <h2 className="table-heading">Table of Users</h2>
          <div className="table-container">
            <table className="table table-success table-striped">
              <thead>
                <tr>
                  <th scope="col">Sr.No</th>
                  <th scope="col">UserName</th>
                  <th scope="col">_id</th>
                  <th scope="col">Email-id</th>
                  <th scope="col">Password</th>
                  <th scope="col">DOB</th>
                  <th scope="col">is_active</th>
                  <th scope="col">is_deleted</th>
                </tr>
              </thead>
              <tbody>
                {users.map((user, index) => (
                  <tr key={user._id}>
                    <th scope="row">{index + 1}</th>
                    <td>{user.userName}</td>
                    <td>{user._id}</td>
                    <td>{user.email}</td>
                    <td>{user.password}</td>
                    <td>{new Date(user.DOB).toLocaleDateString()}</td>
                    <td>
                      <div className="form-check form-switch">
                        <input className="form-check-input" type="checkbox" checked={user.is_active} readOnly />
                        <label className="form-check-label"></label>
                      </div>
                    </td>
                    <td>
                      <div className="form-check form-switch">
                        <input className="form-check-input" type="checkbox" checked={user.is_deleted} readOnly />
                        <label className="form-check-label"></label>
                      </div>
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        </section>
      </main>
    </div>
  );
};

export default Dashboard;
